import React from 'react';
import NavigationBar from "./routes/NavigationBar";
import AppRoute from "./routes/AppRoute";
import Motto from "./components/Motto";
import { BrowserRouter } from "react-router-dom";

const App = () => {
  return (
    <BrowserRouter>
      <NavigationBar />
      <AppRoute />
      <Motto />
    </BrowserRouter>
  );
}


export default App;
